(27, 1, 'مسکن میلاد', 'شرکت ملی انفورماتیک در 22 دی ماه سال 1369 به صورت سهامی خاص در اداره ثبت شرکت‌ها و مالکیت صنعتی تهران به ثبت رسید.شرکت ملی انفورماتیک از بدو تأسیس تلاش داشته و دارد در راس هلدینگ گروه ملی انفورماتیک به عنوان شرکتی جامع و کارآمد، راهبری شبکه‌‌ای منسجم و هماهنگ را بر عهده داشته باشد تا از ظرفیت‌‏های فناوری اطلاعات و ارتباطات داخلی و خارجی،  سرمایه‌‏گذاری متخصصی و مدیریت طرح‌‏های حاکمیتی، بستر تحول در نظام پولی و مالی کشور را فراهم آورد. گروه ملی انفورماتیک با استفاده از اختیارات نظارتی و حاکمیتی محول شده از سوی بانک مرکزی جمهوری اسلامی ایران تلاش می‌کند مأموریت‌های مورد نظر این بانک را در حوزۀ فناوری های نوین در صنعت بانکداری و پرداخت الکترونیکی به انجام رساند.\n\nچشم انداز شرکت ملی انفورماتیک تبدیل شدن به بزرگترین هلدینگ فناوری‌های مالی، پیش‌رو، نوآور، هم‌افزا و تکیه‌گاه فعالان و بازیگران زیست‌بوم‌های خدمات مالی کشور و خوشنام در منطقه تعریف شده است. شرکت ملی انفورماتیک علاوه بر انجام وظایف در رابطه با نیازمندی‌های مشاوره‌ای بانک مرکزی از طریق سه شرکت خدمات انفورماتیک، شاپرک و کاشف که  ذیل شرکت ملی انفورماتیک به عنوان یک گروه و شرکت مادر (Holding Company) فعالیت می‌کنند به انجام مأموریت‌های محول شده از سوی بانک مرکزی می‌پردازد.\n\nشرکت ملی انفورماتیک هم‌افزایی در شرکت‌های گروه، مشارکت با فعالان و بازیگران ارزش‌آفرین و نوآور جهت ارتقای بهره‌وری، پایداری و امنیت در توسعه زیست‌بوم‌های خدمات مالی را ماموریت خود قرار داده است و در این راستا اعتقاد دارد که سرآمدی این شرکت در خلق ارزش‌، توانمندی ذی‌نفعان را تضمین می‌کند.\n\nاز اهداف کلان این شرکت می توان به موارد ذیل اشاره کرد:\n\nارتقاء هم‌افزایی در گروه ملی انفورماتیک\nبازآفرینی مدل‌های خلق ارزش همسو با الزامات عصر دیجیتال در گروه ملی انفورماتیک\nتوسعه سرمایه‌گذاری‌ها و شبکه‌های همکاری هدفمند\nارتقاء قابلیت‌های راهبردی در بنگاه مادر\nگروه ملی انفورماتیک بر اساس همین مأموریت‌ها تا کنون موفق شده خدمات فراوان و ارزشمندی به نظام بانکی و مردم عزیز کشورمان ارائه کند؛ ایجاد بسترهای لازم برای بانکداری متمرکز، ایجاد شبکه شتاب با محوریت شرکت خدمات انفورماتیک، راه‌اندازی و راهبری شبکه پرداخت الکترونیکی و نظارت بر این شبکه از طریق شرکت شاپرک، ارتقای امنیت شبکه بانکی و پرداخت الکترونیکی کشور و نظارت بر سلامت و شفافیت تبادلات از طریق شرکت کاشف و انجام پروژه‌های ملی و حاکمیتی متنوع در حوزه بانک‌داری و پرداخت الکترونیکی از جمله این خدمات ارزنده است.', '3', '150,000,000,000', '', '', 'DRAFT', 1, 1, 'SHASTA', 'oLXkmiiMdnZmBtvEQkFhARlOTPUnjYuqrlfhgDEzMSAKsQcPpgVdKJUefBCN', 12, 620, '0x3a498356f546b4ea2df16981227c552b08fabf79', 1744172719, 1, 1, 1744284167),
